  false,\n\t\"url\": null,\n\t\"notes\": \"A benthic habitat polygon coverage has
  been created of the coral reef ecosystem within and adjacent to Kaloko-Honokohau
  National Historical Park (KAHO) on the Kona Coast of Hawai'i. Polygons were hand-digitized
  from visual interpretation of aerial photography and SHOALS bathymetry data. We
  also utilized in situ knowledge from towed instruments, underwater photography and
  videography, and diver and snorkeler observations. The polygons have attributes
  for Main Structure/Substrate, Dominant Structure/Substrate, Major Biological Cover,
  Percent of Major Biological Cover, Reef Zone, Unique ID, and measurements of Area
  (m2) of each polygon.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
